import React from "react";
import man from '../img/man.png';

function Home() {
    return (
        <div className="home">
            <div className="container">
                <div className="row align-items-center">

                    <div className="col-lg-5">
                        <h1 className="font-weight-light">Riley Litchfield</h1>
                        <h3 className="font-weight-light">Web Developer</h3>
                        <p className="mt-4">
                            I am Proficient in HTML, CSS, JavaScript, React and more...
                        </p>
                    </div>
                    <div className="col-lg-7">
                        <img
                            className="img-fluid rounded mb-4 mb-lg-0"
                            src={man}
                            alt="..."
                        />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
